import { usePagesContext } from '../hooks/usePagesContext';
import { useEffect } from 'react';

const Home = () => {
    const {pages} = usePagesContext();

    return (
        <div className="container">
            <text>All Pages</text>
            {pages && pages.map((page) => (
                <text key={page}>{page}</text>
            ))}
        </div>
    )
}

export default Home;
